	.include "m16adef.inc"

	.def DataL = r22
	.def DataH = r21
	.def AddressX = r17
	.def AddressY = r18
	.def IsW = r25
	.def temp = r26
	.def empty = r23
	.def full = r19
	.def transCount = r27

	.equ DataPort = PORTA
	.equ DataDDR = DDRA

	.equ SizeX = 64
	.equ SizeY = 63

	.equ limitY = SizeY<<2

	clr DataL				;reset registers to 0x00
	clr DataH
	clr AddressX
	clr AddressY
	ldi full, 0xff			;load some useful registers
	
	ldi empty, 0x00
	ldi r20, 0x03
	ldi r16, 0b10000000
	
	out DDRC, r19			;set the output pin to output
	out DDRB, r19
	out DDRD, r19

	ldi r24, 0b11110110

	out DDRA, r24

	ldi r24, 0x02
	ldi	DataL, 0x00
	ldi	DataH, 0x00
    ldi r19, 0b00000100
	ldi	ZL,LOW(2*Pix)	; load 2*Pix
	ldi	ZH,HIGH(2*Pix)	; into Z pointer
	rjmp outputAll

starting:
	clr AddressX
	clr AddressY
	ldi	DataL, 0xFF
	ldi	DataH, 0x00
	rjmp SendData

loopStart:


	lpm	DataH, Z+
	lpm	DataL, Z+
	inc AddressX
    cpi AddressX, 64
	breq incY

	;rjmp SendData
	rjmp outputPix


incY:
	clr AddressX
	add AddressY, r19
    cpi AddressY, limitY
    breq EndLoop
    rjmp loopStart

EndLoop:
    jmp EndLoop

outputPix:
	in IsW, PINA			;read PORTA
	andi IsW, 0b00000001	;apply a mask to get the first bit
	subi IsW, 0x01			;substact 1
	brne outputPix			;jump to output if it's not nul, so when input is 0
	out PORTC,DataL			;output the first 8bit data to PORTC	
	out PORTA, r24			;toggle the clock 
	out PORTC,DataH			;output the last 8bit data to PORTC	
	out PORTA, r23			;toggle the clock 
	out PORTD, AddressY		
	add AddressX, r16	
	out PORTB,AddressX
	sub AddressX, r16
	out PORTB, r23
	out PORTD, r23
	out PORTC, r23
	out PORTA, r24			;toggle the clock 
	out PORTA, r23			;toggle the clock 
	rjmp loopStart


outputAll:

	out PORTC,DataL			;output the first 8bit data to PORTC	
	out PORTA, r24			;toggle the clock 
	out PORTC,DataH			;output the last 8bit data to PORTC	
	out PORTA, r23			;toggle the clock 
whait:
	in IsW, PINA			;read PORTA
	andi IsW, 0b00000001	;apply a mask to get the first bit
	subi IsW, 0x01			;substact 1
	brne whait				;jump to output if it's not nul, so when input is 0
	out PORTD, AddressY
	add AddressX, r16
	out PORTB,AddressX
	sub AddressX, r16
	out PORTB,AddressX
	inc AddressX
	out PORTB, r23
	out PORTD, r23
	out PORTC, r23	
	out PORTA, r24			;toggle the clock 
	out PORTA, r23			;toggle the clock 
	cpi AddressX, 0x80
	breq upY
	rjmp outputAll

upY: 
	add AddressY, r19
	clr AddressX
	cpi AddressY, 0xFC
	out PORTC, r23	
	breq start
	rjmp outputAll
start: 
	clr AddressX
	clr AddressY
	jmp loopStart


whaitData:	in temp, PINA				;wait for data
			andi temp, 0b00001000		;compare data with 0x00
			cpi temp, 0b00001000  		;if data is not 0x00, then do not continue
			brne whaitData 				;else wait for data
			in temp, PINA				;read data
			andi temp, 0b11110000		;apply a mask to get the first 4 bit
			out DataPort, empty			;clear data port
			cpi transCount, 4			;check the transfer count
			breq trans0					;and jump to the right transfer
			cpi transCount, 5
			breq trans1
			cpi transCount, 6
			breq trans2
			cpi transCount, 7
			breq trans3
			ldi temp, 0b11110110
			out DataDDR, temp
			rjmp outputPix				;finally, output the pixel to the RAM

whaitClear:	in temp, PINA				;wait for data
			andi temp, 0b00001000		;compare data with 0x00
			cpi temp, 0b00001000  		;if data is not 0x00, then continue
			brne whaitClear 			;else wait for data
			rjmp whaitData				;wait for data

trans0:		in temp, PINA				;read data
			;ldi temp, 0xf0				;test
			andi temp, 0b11110000		;apply a mask to get the first 4 bit
			mov DataL, temp				;move data to DataL
			inc transCount				;increase transfer count
			ldi temp, 0b00000100		;tell the other chip that data has been reacived
			out DataPort, temp			;output the data
			rjmp whaitClear				;return to wait for new data

trans1:		in temp, PINA				;read data
			andi temp, 0b11110000		;apply a mask to get the first 4 bit
			;ldi temp, 0xf0				;test
			lsr temp					;shift data 4 times to the right
			lsr temp
			lsr temp
			lsr temp
			or DataL, temp				;or the data with DataL
			inc transCount				;increase transfer count
			ldi temp, 0b00000100		;tell the other chip that data has been reacived
			out DataPort, temp			;output the data
			rjmp whaitClear				;return to wait for new data

trans2:		in temp, PINA				;read data
			andi temp, 0b11110000		;apply a mask to get the first 4 bit
			;ldi temp, 0xf0				;test
			mov DataH, temp				;move data to DataL
			inc transCount				;increase transfer count
			ldi temp, 0b00000100		;tell the other chip that data ha
			out DataPort, temp			;output the data
			rjmp whaitClear				;return to wait for new data

trans3:		in temp, PINA				;read data
			andi temp, 0b11110000		;apply a mask to get the first 4 bit
			;ldi temp, 0xf0				;test
			lsr temp					;shift data 4 times to the right
			lsr temp
			lsr temp
			lsr temp	
			or DataH, temp				;or the data with DataL
			inc transCount				;increase transfer count
			ldi temp, 0b00000100		;tell the other chip that data has been reacived
			out DataPort, temp			;output the data
			rjmp whaitClear				;return to wait for new data

SendClear:	in temp, PINA				;wait for data
			andi temp, 0b00001000		;compare data with 0b00001000
			cpi temp, 0b00001000  		;if data is not 0x00, then continue
			brne SendClear  			;else wait for data
			out DataPort, empty			;clear data port

SendData:	cpi transCount, 0
			breq trans4
			cpi transCount, 1
			breq trans5
			cpi transCount, 2
			breq trans6
			cpi transCount, 3
			breq trans7

trans4:		mov temp, AddressX
			inc transCount
			lsl temp
			lsl temp
			lsl temp
			lsl temp
			andi temp, 0b11110000
			ori temp, 0b00000100
			out DataPort, temp
			rjmp SendClear

trans5:		mov temp, AddressX
			inc transCount
			andi temp, 0b11110000
			ori temp, 0b00000100
			out DataPort, temp
			rjmp SendClear

trans6:		mov temp, AddressY
			inc transCount
			lsr temp
			lsr temp
			andi temp, 0b11110000
			ori temp, 0b00000100
			out DataPort, temp
			rjmp SendClear

trans7:		mov temp, AddressY
			inc transCount
			lsl temp
			lsl temp
			andi temp, 0b11110000
			ldi temp, 0b00000110
			out DataDDR, temp
			ori temp, 0b00000100
			out DataPort, temp
			rjmp whaitData



